import React from 'react'

const style = {
    marginRight: 10
};
class List extends componenet {
    constructor() {
        super()
        state = {
            description: []
        }
    }
    render() {
        return (
            <div>
                <div className="container">
                    <div className="card">
                        <div className="card-body">
                            <div className="row">
                                <div className="col"></div>
                                <div className="col">
                                    {this.state.description.map(data => (
                                        <div>{data.des}</div>
                                    ))}
                                    {/* {this.state.description.des} , {this.state.description.color} */}
                                </div>
                                <div className="col">
                                    <button className="btn btn-outline-secondary">Update</button>
                                    <button className="btn btn-outline-secondary">Delete</button>
                                </div>
                            </div>
                            <div></div>
                            <div></div>
                            <div></div>
                            <div></div>
                        </div>
                    </div>
                </div>
            </div>
        )

    }
}

this.setState({
    description: [
        { des: 'Description', color: 'Green' },
        { des: 'Description', color: 'Green' },
        { des: 'Description', color: 'Green' },
        { des: 'Description', color: 'Green' },
        { des: 'Description', color: 'Green' },
        { des: 'Description', color: 'Green' }
    ]
})

export default List;
